import React from "react"

class Prices extends React.component {
    constructor(props) {
        this.state = {
            currency:"USD"
        }
    }

    render() {
        return (<div>
            Prices : {this.state.currency} { this.props.children} 
        </div>)
    }
}

export default Prices
